import React, { useEffect, useState } from 'react';
import { Line } from 'react-chartjs-2';

function App() {
  const [data, setData] = useState(null);
  const [chartData, setChartData] = useState({
    labels: [],
    datasets: [{
      label: 'Event Count Over Time',
      data: [],
      borderColor: 'black',
      backgroundColor: 'transparent'
    }]
  });

  useEffect(() => {
    const fetchData = () => {
      fetch('http://localhost:3000/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Accept': 'application/json',
        },
        body: JSON.stringify({
          query: `
            query {
              data(orderBy: id, first: 1) {
                nb_block
                starknet_block
                eventCount
                goerliblock
              }
            }
          `
        })
      })
      .then(r => r.json())
      .then(data => {
        console.log('API response:', data);
        setData(data.data.data);

        setChartData(prevData => {
          const newData = {...prevData};
          newData.labels.push(data.data.data[0].nb_block);
          newData.datasets[0].data.push(data.data.data[0].eventCount);
          return newData;
        });
      })
      .catch(error => console.error('Error fetching data:', error));
    };

    fetchData();
    const intervalId = setInterval(fetchData, 5000);

    return () => {
      clearInterval(intervalId);
    };
  }, []);

  if (!data) {
    return <div>Loading...</div>;
  }

  const tableStyle = {
    color: 'black',
    border: '2px solid black',
    borderRadius: '5px',
    backgroundColor: 'white',
    width: '80%',
    borderCollapse: 'separate',
    borderSpacing: '0',
    margin: '20px 0'
  };

  const cellStyle = {
    padding: '10px',
    border: '1px solid black'
  };

  return (
    <div style={{ backgroundColor: '#6a0dad', height: '100vh', color: 'white', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'flex-start', padding: '50px 0' }}>
      <h1 style={{ textShadow: '2px 2px #8B4513', color: 'yellow' }}>Alakazam</h1>
      <table style={tableStyle}>
        <thead>
          <tr>
            <th style={cellStyle}>Id</th>
            <th style={cellStyle}>Name</th>
            <th style={cellStyle}>Layer</th>
            <th style={cellStyle}>Number Total of Block</th>
            <th style={cellStyle}>Actual Block of Indexing</th>
            <th style={cellStyle}>Number of Event</th>
          </tr>
        </thead>
        <tbody>
          {data.map((d, index) => (
            <>
              <tr key={index}>
                <td style={cellStyle}>{index + 1}</td>
                <td style={cellStyle}>Starknet</td>
                <td style={cellStyle}>L2</td>
                <td style={cellStyle}>{d.starknet_block}</td>
                <td style={cellStyle}>{d.nb_block}</td>
                <td style={cellStyle}>{d.eventCount}</td>
              </tr>
              <tr key={index+100}>
                <td style={cellStyle}>2</td>
                <td style={cellStyle}>Goerli Starknet</td>
                <td style={cellStyle}>L2 (testnet)</td>
                <td style={cellStyle}>{d.goerliblock}</td>
                <td style={cellStyle}>soon</td>
                <td style={cellStyle}>soon</td>
              </tr>
            </>
          ))}
        </tbody>
      </table>
      <Line data={chartData} options={{ responsive: true, maintainAspectRatio: false }}/>
    </div>
  );
}

export default App;
